import React from "react";

import './footer.css';
import { Container, Row, Col, ListGroup, ListGroupItem } from "reactstrap";
import { Link } from "react-router-dom";
import logo from '../../assets/images/logo.png'

const quick_links = [
    {
        path: '/home',
        display: 'Home'
    },
    {
        path: '/tours',
        display: 'Tours'
    },
    {
        path: '/about',
        display: 'About'
    },
]

const quick_links2 = [
    {
        path: '/gallery',
        display: 'Gallery'
    },
    {
        path: '/login',
        display: 'Login'
    },
    {
        path: '/register',
        display: 'About'
    },
]

const Footer = () => {
    return <div>Footer</div>
};

export default Footer;
